import Layout from '../components/Layout'
import TeamBuilding from '../components/TeamBuilding'
import { teamMembers } from '../assets/js/data'

function Team() {
  return (
    <Layout>
      <TeamBuilding data={teamMembers} altLayout={true}/>
    </Layout>
  )
}

export default Team
